package dreamSchool.cscourse.chapter04;

public class InDeperatorTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number1 = 20;
		
		System.out.println(++number1); //21
		System.out.println(number1++); //22
		System.out.println(--number1); //21
		System.out.println(number1--); //20

	}

}
